import React, { useState } from 'react';
import { useAuth } from '../context/AuthContext';
import { FaUsers, FaChartBar, FaCog, FaSignOutAlt, FaHome, FaSubscript, FaUserFriends, FaCreditCard, FaFileAlt, FaBars, FaTimes } from 'react-icons/fa';

const AdminDashboard = () => {
  const { user, logout } = useAuth();
  const [activeTab, setActiveTab] = useState('dashboard');
  const [sidebarOpen, setSidebarOpen] = useState(false);

  const handleLogout = () => {
    logout();
    window.location.href = '/login';
  };

  const menuItems = [
    { id: 'dashboard', label: 'Dashboard', icon: FaHome },
    { id: 'subscriptions', label: 'Subscriptions', icon: FaSubscript },
    { id: 'subscribers', label: 'Subscribers', icon: FaUserFriends },
    { id: 'transactions', label: 'Transactions', icon: FaCreditCard },
    { id: 'reports', label: 'Reports', icon: FaFileAlt },
  ];

  return (
    <div className="min-h-screen bg-gray-100 flex">
      {/* Sidebar */}
      <div className={`bg-white shadow-lg transition-all duration-300 ${sidebarOpen ? 'w-64' : 'w-16'} lg:w-64`}>
        <div className="p-4">
          <div className="flex items-center justify-between">
            <div className={`flex items-center ${sidebarOpen ? 'block' : 'hidden'} lg:block`}>
              <FaHome className="text-blue-600 text-2xl mr-3" />
              <h1 className="text-lg font-semibold text-gray-900">Admin Panel</h1>
            </div>
            <button
              onClick={() => setSidebarOpen(!sidebarOpen)}
              className="lg:hidden text-gray-500 hover:text-gray-700"
            >
              {sidebarOpen ? <FaTimes /> : <FaBars />}
            </button>
          </div>
        </div>

        <nav className="mt-8">
          {menuItems.map((item) => {
            const Icon = item.icon;
            return (
              <button
                key={item.id}
                onClick={() => setActiveTab(item.id)}
                className={`w-full flex items-center px-4 py-3 text-left hover:bg-blue-50 transition ${
                  activeTab === item.id ? 'bg-blue-100 border-r-4 border-blue-600 text-blue-700' : 'text-gray-700'
                }`}
              >
                <Icon className="text-lg mr-3" />
                <span className={`${sidebarOpen ? 'block' : 'hidden'} lg:block`}>{item.label}</span>
              </button>
            );
          })}
        </nav>

        <div className="absolute bottom-4 left-4 right-4">
          <button
            onClick={handleLogout}
            className="w-full flex items-center px-4 py-3 text-gray-500 hover:text-gray-700 hover:bg-gray-50 rounded transition"
          >
            <FaSignOutAlt className="text-lg mr-3" />
            <span className={`${sidebarOpen ? 'block' : 'hidden'} lg:block`}>Logout</span>
          </button>
        </div>
      </div>

      {/* Main Content */}
      <div className="flex-1">
        {/* Header */}
        <header className="bg-white shadow-sm border-b">
          <div className="px-4 sm:px-6 lg:px-8">
            <div className="flex justify-between items-center h-16">
              <div className="flex items-center">
                <button
                  onClick={() => setSidebarOpen(!sidebarOpen)}
                  className="lg:hidden text-gray-500 hover:text-gray-700 mr-4"
                >
                  <FaBars />
                </button>
                <h2 className="text-xl font-semibold text-gray-900 capitalize">{activeTab}</h2>
              </div>
              <div className="flex items-center space-x-4">
                <span className="text-sm text-gray-700">Welcome, {user?.name || user?.email}</span>
              </div>
            </div>
          </div>
        </header>

        {/* Content Area */}
        <main className="p-6">
          {activeTab === 'dashboard' && (
            <div>
              {/* Stats Cards */}
              <div className="grid grid-cols-1 md:grid-cols-4 gap-6 mb-8">
                <div className="bg-white overflow-hidden shadow rounded-lg">
                  <div className="p-5">
                    <div className="flex items-center">
                      <FaSubscript className="h-6 w-6 text-blue-600 mr-3" />
                      <div>
                        <p className="text-sm font-medium text-gray-500">Subscriptions</p>
                        <p className="text-2xl font-bold text-gray-900">24</p>
                      </div>
                    </div>
                  </div>
                </div>
                <div className="bg-white overflow-hidden shadow rounded-lg">
                  <div className="p-5">
                    <div className="flex items-center">
                      <FaUserFriends className="h-6 w-6 text-green-600 mr-3" />
                      <div>
                        <p className="text-sm font-medium text-gray-500">Subscribers</p>
                        <p className="text-2xl font-bold text-gray-900">156</p>
                      </div>
                    </div>
                  </div>
                </div>
                <div className="bg-white overflow-hidden shadow rounded-lg">
                  <div className="p-5">
                    <div className="flex items-center">
                      <FaCreditCard className="h-6 w-6 text-purple-600 mr-3" />
                      <div>
                        <p className="text-sm font-medium text-gray-500">Transactions</p>
                        <p className="text-2xl font-bold text-gray-900">89</p>
                      </div>
                    </div>
                  </div>
                </div>
                <div className="bg-white overflow-hidden shadow rounded-lg">
                  <div className="p-5">
                    <div className="flex items-center">
                      <FaFileAlt className="h-6 w-6 text-orange-600 mr-3" />
                      <div>
                        <p className="text-sm font-medium text-gray-500">Reports</p>
                        <p className="text-2xl font-bold text-gray-900">12</p>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          )}

          {activeTab === 'subscriptions' && (
            <div className="bg-white shadow rounded-lg p-6">
              <h3 className="text-lg font-medium text-gray-900 mb-4">Subscription Management</h3>
              <p className="text-gray-600">Manage all subscription plans and pricing.</p>
            </div>
          )}

          {activeTab === 'subscribers' && (
            <SubscribersPage />
          )}

          {activeTab === 'transactions' && (
            <div className="bg-white shadow rounded-lg p-6">
